window.bookSummaryJSON = "<p>The secrets of the factory of nightmares are free for the taking...and Dungeon Lord Edward Wright intends to claim them.</p> <p>War is coming to Starevos, delivered by the navy of the Kingdom of Heiliges. The only hope Edward and his friends have at surviving the wrath of the Light is an ancient Factory whose defenses are as deadly as those seeking to conquer it.</p> <p>However, Ed is not the only Dungeon Lord who seeks the power of the factory. To save the Haunt, Ed must face war-forged Dungeon Lords older and crueler than he is, and everything he has learned shall be tested to its utter limit.</p> <p>Even before the Endeavor starts, dark forces converge around the Haunt, threatening to drown Ed and his friends under a mass of corpses. If Ed is not careful, he may be forced to become as terrible as his enemies just to outlive them.</p> <p>In fact, that may well be his only chance at victory.</p> <p>Will Edward have what it takes to prove he is the meanest Dungeon Lord around, or will he become a footnote in the annals of history?</p> <p>There's only one way to find out.</p>"; 
